import react from 'react';
import './Navbar.css';

const Navbar = () => {
    return(
       <div classname='nav'>
        <div className='nav-body'>
            <div className='nav-title'>
                Fly High
            </div>
            <div className='nav-links'>
                <ul>
                    <li>Home</li>
                    <li>Contact</li>
                    <li>Login</li>
                </ul>
            </div>
        </div>
       </div>
    );
}
export default Navbar;
